(159755, '1A89A43F-45E2-4BBB-8B3A-743B0DC8EB7F', 'Remember when we used to send love notes...here''s mine for today.  Life throws unexpected things in our way all the time. I met you unexpectedly. And then we said we would go through life together and manage unexpected things together and that felt really exciting. So now we are in it. Not just saying it but living it. And I still feel the same way - so glad to be on your team.', 'Nitzan', 'David', '2016-04-11T09:36:21'),
(159828, '7537AA8F-77B6-4731-9A1E-33D50AB62DE2', 'What''s the saying about how G-d laughs at our plans? I love going through the unexpected twists and turns with you.  It can feel a bit scary...but a bit scary can mean that we are testing ourselves. I''m thrilled to be sharing this journey with you, love. Small things like planning our first Seder together...sometimes hard for me to fathom how lucky I feel to have you as my partner. ', 'David', 'Nitzan', '2016-04-11T10:17:52'),
